import React, { Component } from 'react';       

import "../styles/BottomNavBar.css";

// Side Nav imports
import SideNav, { NavItem, NavIcon, NavText } from "@trendmicro/react-sidenav";

// Be sure to include styles at some point, probably during your bootstraping
import "@trendmicro/react-sidenav/dist/react-sidenav.css";

class BottomNavBar extends Component {
    state = {  }
    render() { 
        return ( <div id="NavBarContainer"> 
                    <div id="innerNavDiv">
                        <div id="SessionTab">
                            <i 
                            id="TabIcon"
                            className="fa fa-fw fa-play-circle"
                            style={{ fontSize: "1.5em"}}
                            />
                            <p id="TabText">Session</p>
                        </div>
                        <div id="SearchTab">
                            <i 
                            id="TabIcon"
                            className="fa fa-fw fa-search"
                            style={{ fontSize: "1.5em"}}
                            />
                            <p id="TabText">Search</p>
                        </div>
                        <div id="LibraryTab">
                            <i 
                            id="TabIcon"
                            className="fa fa-fw fa-book"
                            style={{ fontSize: "1.5em"}}
                            />
                            <p id="TabText">Library</p>
                        </div>
                        <div id="AccountsTab">
                            <i 
                            id="TabIcon"
                            className="fa fa-fw fa-user-circle"
                            style={{ fontSize: "1.5em"}}
                            />
                            <p id="TabText">Music Accounts</p>
                        </div>
                    </div>
                </div> );
    }
}

export default BottomNavBar;
